


def first_uniq_char(s)
	hash_map = {}
    s.each_char do |char|
    	if hash_map[char] != nil
    		hash_map[char] = hash_map[char] + 1
    	else
    		hash_map[char] = 1
    	end 
    end
    hash_map.each_with_index do |(k,v),i|
    	if v == 1 then return s.index(k) end
    end
    return -1
    end

s = ""

pp first_uniq_char(s)





